  let scale = matches ? 1 : 1.3;
  let translateY = matches ? 0 : -27;

  return (
    <div className="servicesArguments2">
      <Textes
        titre={["Full service", "(02)"]}
        texte={[
          "Parce que chaque client est différent, nous pouvons prendre entièrement votre shooting en charge ! et pas que...  Du transport de vos produits par notre équipe, aux retouches, jusqu’à la mise en ligne de vos contenus. ",
          "N’hésitez pas à nous faire part de vos plus folles demandes.",
        ]}
        AnimationBloc3={AnimationBloc4}
      />

      <IMG
        imgsrc={IMGFichier}
        imgsrcWebp={IMGFichierWebp}
        alt=""
        translateX={0}
        translateY={translateY}
        scale={scale}
        setAnimationBloc3={setAnimationBloc4}
        AnimationBloc3={AnimationBloc4}
      />

      {/* {
                matches ? 
                ''
                :
                <div className="boutonService">
                    <div className="boutonWrapper">
                        <ButtonRond AnimationBloc3={AnimationBloc4}></ButtonRond>
                    </div>
                </div>
            } */}
    </div>
  );
};

export default Services2;
